import "./Chat.css";
class ChatHead extends Component {
  state = {};
  render() {
    return (
      <div>
        <div className="Card">
          <div class="row">
            <div class="col s2">
              {" "}
              <div className="User" />
            </div>
            <div class="col s10">6</div>
          </div>
          <div className="Avatar" />
        </div>
      </div>
    );
  }
}

export default ChatHead;
